import React from "react";
import ReactDOM from "react-dom";

const App = () => {
    window.navigator.geolocation.getCurrentPosition (
        (position) => console.log(position),
        (err) => console.log(err)
    );

    <div>HELLO</div>
};


ReactDOM.render(
    <App />,
    document.querySelector("#root")
);
